const canvas = document.getElementById('canvas1');
const ctx = canvas.getContext('2d');

canvas.width = 800;
canvas.height = 450;

const image1 = new Image();
// image1.src = 'image1.png';
//used online PNG to base 64
image1.src =
  'data:image/png;base64,';

image1.addEventListener('load', () => {
  ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
  const scannedImage = ctx.getImageData(0, 0, canvas.width, canvas.height);
  console.log(scannedImage);
  const scannedDate = scannedImage.data;
  //grayfilter
  for (let i = 0; i < scannedDate.length; i += 4) {
    const total = scannedDate[i] + scannedDate[i + 1] + scannedDate[i + 2];
    const averageColorValue = total / 3;
    scannedDate[i] = averageColorValue;
    scannedDate[i + 1] = averageColorValue;
    scannedDate[i + 2] = averageColorValue;
  }
  scannedImage.data = scannedDate;
  ctx.putImageData(scannedImage, 0, 0);
});
